A tough, bitter fugitive's travels lead him to a grungy rundown oil town. There the transient is taken in by an oil-rigger who gives him a job working a well. They must work double-quick for the well's lease is due to expire. Unfortunately, they become so focused on striking oil quickly, they forget about safety and several men are hurt. Meanwhile the kindly crew boss and the fugitive vie for the affections of a life-hardened woman.


